import React from 'react';

const Index = () => {
  return (
    <div className="p-4">
      <h2 className="text-xl font-bold">Welcome to Fresh Farm</h2>
      <p>Fill out the form to get in touch with us.</p>
    </div>
  );
};

export default Index;
